import './App.css';
import logo from './images/Semantic_Scholar_logo.svg.png';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Semantic Scholar Super Search
          <img src={logo} alt="Logo" className='logo_image'/>
      </header>

       <div className='search'>
           <span>Search In Papers</span>
           <div>
                <input type="text" className="search-input" placeholder="Title Query" />
           </div>
            <div>
                <input type="text" className="search-input" placeholder="Abstract Query" />
           </div>
           <div>
                <input type="text" className="search-input" placeholder="Title Search Weight" />
           </div>
            <button className="search-button">Search</button>

       </div>

    </div>
  );
}

export default App;
